{
  "name": "UBX-NAV-SVINFO",
  "class_id": "0x01",
  "message_id": "0x30",
  "description": "Space vehicle information. This message has only been retained for backwards compatibility; users are recommended to use the UBX-NAV-SAT message in preference.",
  "message_type": "output",
  "payload": {
    "length": {
      "variable": {
        "base": 8,
        "formula": "8 + 12*numCh",
        "min": 8
      }
    },
    "fields": [
      {
        "name": "iTOW",
        "byte_offset": 0,
        "data_type": "U4",
        "description": "GPS time of week of the navigation epoch. See the description of iTOW for details.",
        "unit": "ms"
      },
      {
        "name": "numCh",
        "byte_offset": 4,
        "data_type": "U1",
        "description": "Number of channels"
      },
      {
        "name": "globalFlags",
        "byte_offset": 5,
        "data_type": "X1",
        "description": "Bitmask",
        "bitfield": {
          "bits": [
            {
              "name": "chipGen",
              "bit_start": 0,
              "bit_end": 2,
              "description": "Chip hardware generation: 0: Antaris, Antaris 4; 1: u-blox 5; 2: u-blox 6; 3: u-blox 7; 4: u-blox 8/u-blox M8"
            }
          ]
        }
      },
      {
        "name": "reserved1",
        "byte_offset": 6,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "description": "Reserved",
        "reserved": true
      }
    ],
    "repeated_groups": [
      {
        "name": "channels",
        "repetition_type": "count_field",
        "count_field": "numCh",
        "group_size_bytes": 12,
        "base_offset": 8,
        "fields": [
          {
            "name": "chn",
            "byte_offset": 0,
            "data_type": "U1",
            "description": "Channel number, 255 for SVs not assigned to a channel"
          },
          {
            "name": "svid",
            "byte_offset": 1,
            "data_type": "U1",
            "description": "Satellite ID, see Satellite Numbering for assignment"
          },
          {
            "name": "flags",
            "byte_offset": 2,
            "data_type": "X1",
            "description": "Bitmask",
            "bitfield": {
              "bits": [
                {
                  "name": "svUsed",
                  "bit_start": 0,
                  "bit_end": 0,
                  "description": "SV is used for navigation"
                },
                {
                  "name": "diffCorr",
                  "bit_start": 1,
                  "bit_end": 1,
                  "description": "Differential correction data is available for this SV"
                },
                {
                  "name": "orbitAvail",
                  "bit_start": 2,
                  "bit_end": 2,
                  "description": "Orbit information is available for this SV (Ephemeris or Almanac)"
                },
                {
                  "name": "orbitEph",
                  "bit_start": 3,
                  "bit_end": 3,
                  "description": "Orbit information is Ephemeris"
                },
                {
                  "name": "unhealthy",
                  "bit_start": 4,
                  "bit_end": 4,
                  "description": "SV is unhealthy / shall not be used"
                },
                {
                  "name": "orbitAlm",
                  "bit_start": 5,
                  "bit_end": 5,
                  "description": "Orbit information is Almanac Plus"
                },
                {
                  "name": "orbitAop",
                  "bit_start": 6,
                  "bit_end": 6,
                  "description": "Orbit information is AssistNow Autonomous"
                },
                {
                  "name": "smoothed",
                  "bit_start": 7,
                  "bit_end": 7,
                  "description": "Carrier smoothed pseudorange used"
                }
              ]
            }
          },
          {
            "name": "quality",
            "byte_offset": 3,
            "data_type": "X1",
            "description": "Bitfield",
            "bitfield": {
              "bits": [
                {
                  "name": "qualityInd",
                  "bit_start": 0,
                  "bit_end": 3,
                  "description": "Signal Quality indicator (range 0..7). 0: no signal; 1: searching signal; 2: signal acquired; 3: signal detected but unusable; 4: code locked and time synchronized; 5, 6, 7: code and carrier locked and time synchronized"
                }
              ]
            }
          },
          {
            "name": "cno",
            "byte_offset": 4,
            "data_type": "U1",
            "description": "Carrier to Noise Ratio (Signal Strength)",
            "unit": "dBHz"
          },
          {
            "name": "elev",
            "byte_offset": 5,
            "data_type": "I1",
            "description": "Elevation in integer degrees",
            "unit": "deg"
          },
          {
            "name": "azim",
            "byte_offset": 6,
            "data_type": "I2",
            "description": "Azimuth in integer degrees",
            "unit": "deg"
          },
          {
            "name": "prRes",
            "byte_offset": 8,
            "data_type": "I4",
            "description": "Pseudo range residual in centimeters",
            "unit": "cm"
          }
        ]
      }
    ]
  }
}

